INSERT INTO `zj_publish` VALUES ('313', '292', '北京市昌平区出租升降机', '', '/Uploads/img/20160301/145681424013357.png,/Uploads/img/20160301/145681424017083.png,/Uploads/img/20160301/145681424027926.jpg,/Uploads/img/20160301/145681424020739.png', '12', '30', '各种型号', '36', '49', '', '2', '昌平- 东小口- 北京', '\r\n\r\n北京博诚宇业机电设备有限公司为厂房停电、酒店宾馆临时用电、演艺拍摄、展示灯光用电、商务办公发电、居民小区发电、各种活动、建筑工程、路桥施工等发电。\r\n\r\n租赁30KW---1200KW,普通型,静音型,移动型,车载型均有。\r\n\r\n\r\n品牌：\r\n\r\n大宇，康明斯，沃尔沃，道依茨，三菱等。 \r\n\r\n\r\n北京双杰和兴发电机租赁中心专业从事静音发电机出租.发电车租赁.柴油发电机组，规格齐全。\r\n\r\n \r\n\r\n具体规格有\r\n\r\n30KW、50KW、75KW、90KW、120KW、200KW、250KW、300KW、400KW、500KW、600KW、800KW、1100KW 供客户选择。\r\n\r\n\r\n进口柴油发电机组随时为客户提供不同功率机组自备发电业务，电力供应保障充足，为各项工地施工、消防备用、企业避峰、短期自备发电的首选 。调试、维护、设备，根据客户需要24小时随时发电。 完善的服务 解决您的后顾之忧 。\r\n\r\n\r\n24小时为您开通，随时为用户提供咨询服务。\r\n\r\n\r\n为您提供长短期及临时用电租赁服务，租赁方式任您选择： \r\n\r\n\r\n1、发电服务由我公司负责，派专人专车到现场为用户发电，派操作技工实施监控。 \r\n\r\n2、我公司提供发电设备，负责发电设备安装及运行。 \r\n\r\n3、供应发电机组附属用品电缆等。 \r\n\r\n4、油罐配送车24小时为用户配送符合发电机组所需高品质柴油。 \r\n\r\n5、为大负荷供电可提供2台或多台机器并机作业。\r\n\r\n\r\n您选择了我们，是你正确的抉择！欢迎来电咨询！\r\n\r\n联系我时，请说是在建遇良才看到的，谢谢！', ' 赵先生', '13651133112', '1', '', '', '', '', '', '', '', '1456814240', '', '1', '0', '', '1');
