INSERT INTO `zj_publish` VALUES ('315', '294', '北京市朝阳区特惠 三角龙骨、主骨 铝边角 大吊 北京全城配送店', '特惠 三角龙骨、主骨 铝边角 大吊 北京全城配送', '', '', '', '', '36', '41', '', '2', '朝阳- 国贸- 北京丰台看丹桥', '厂家批发，高级三角龙骨，铝边角。送货及时，服务到家。欢迎各届老板公司合作垂询。 北京全城配送。外地物流批发配送。欢迎选购。\r\n我厂是一家综合实力强大的企业，我们公司主打三角龙骨产品，公司地理位置优越，交通便利，自驾或乘车非常便利。我厂研发、生产、销售型号齐全的三角龙骨、三维扣板专用龙骨、带钢及龙骨材料等，符合国家标准，并且可以根据客户的需要定制满意产品，并提供送货上门，客户可放心订购。\r\n公司多年来实力不断壮大，现拥有专业先进的生产设备及一批专业的技术研发人员。公司产品技术指标已达到或超过国家标准。产品销售全国各地，近年来业务发展到海外场，远销德国、英国、法国、加拿大、澳大利亚、俄罗斯、亚洲非洲国家和地区。多年来我们已经建立了完整的网络销售模式，拥有训练有素的销售人员及工程设计人员，同时坚持强化内部管理，大力推动技术革新。\r\n我们始终以“质量第一、用户至上”为宗旨，“以信誉求发展，以质量求生存”为经营理念。以更新的产品、更高的质量、更全面的服务、与国内外新老用户共创美好的未来！ 我们也将不断地引进国内外先进的生产设备和学习最新的领先技术，为消费者提供更优质的产品奠定了良好的基础，公司深受客户的信任，成为顾客心目中的最佳龙骨材料生产厂家，公司将继续服务于客户，以生产出更好的产品为己任。欢迎选购德福三角龙骨厂产品，我们真诚的期待您的到来。', '朱先生', '15652301296', '5', '', '', '', '', '', '', '', '1456814738', '14', '1', '0', '', '1');
INSERT INTO `zj_publish` VALUES ('316', '296', '北京市通州区北京密集母线槽店', '北京密集母线槽', '', '', '', '', '36', '47', '', '2', ' 通州- 张家湾- 518号', '宝力威电气（北京）有限公司是一家专业生产各类高、低压母线槽、电缆桥架、配电箱柜等输配电设备的现代化企业，位于北京市通州区经济开发区，交通便利，环境优美，占地面积38628平方米，约58亩，建筑面积22800平方米，其中生产厂房面积约20000平方米，办公面积2800平方米。注册资金5180万元。现有职工188人，其中高级工程师8人，高级经济师2人，工程师22人，技术人员56人，企业管理和技术力量十分雄厚。 \r\n', '成先生', '13811252335', '5', '', '', '', '', '', '', '', '1456815699', '11', '1', '0', '', '1');
INSERT INTO `zj_publish` VALUES ('317', '295', '北京市顺义区出租电动吊篮', '', '/Uploads/img/20160301/145681570838995.png,/Uploads/img/20160301/145681570847543.png', '16', '30', '各种型号', '36', '48', '', '2', '顺义城区- 马坡 ', ' 承揽北京全市范围工程机械设备租赁、无机料、机配石、砂石料供给、土建施工开槽工程 北京明圣居建筑工程有限公司常年提供15-50铲车、35-360挖掘机、150、210胶轮式勾机、8-500吨吊车、3-15吨叉车、2-22吨压路机、160-180刮平机、天泵37—56米、车载泵、混泥土运输车、重载自卸车、切割机、旋耕机、8吨自卸车.拉货运输车、箱式货车、板车、翻斗、半挂等租赁。\r\n\r\n\r\n业务范围：承揽园林绿化、专业旋挖树坑栽树、慌地平整、回填、开槽、平整场地、路面硬化、路面破碎、基础开发，排水管道，渣土外运、大件搬运、吊装作业、市政自来水工程等。\r\n\r\n\r\n本司将以高标准的科学管理与国际接轨的一流水准全面推动服务质量和技术水平，保证以客为尊的三一原则：安全第一，技术第一，信誉第一，更好地协助各个企业再创辉煌。\r\n\r\n\r\n公司前后与中铁建设、北京城建五城建集团、北京城建七建设集团、中铁二局股份有限公司、新兴建设、住总集团、北京市政二处、中铁十九局、中铁四局、中铁十三局、北京易成市政、建工建团、住总集团合作，荣获各个单位的一致好评， 荣获“优秀合作企业奖 ”“诚实信用企业”。\r\n\r\n\r\n公司领导及其所有员工欢迎各位同仁来电洽谈和实地考察。\r\n\r\n\r\n同行勿扰，谢谢！\r\n\r\n联系我时，请说是在建遇良才看到的，谢谢！', '王经理', '13301371585', '1', '', '', '', '', '', '', '', '1456815708', '', '1', '0', '', '1');
INSERT INTO `zj_publish` VALUES ('318', '297', '北京市朝阳区出租脚手架', '', '/Uploads/img/20160301/14568163546881.png,/Uploads/img/20160301/14568163541843.png,/Uploads/img/20160301/145681635444839.png', '22', '100', '各种型号', '36', '41', '', '2', '朝阳- 来广营- 北京市朝阳出北五环来广营北路', ' 脚手架出租、脚手架租赁、脚手架搭建、围挡搭建、钢管、卡子\r\n北京东鸿租赁有限公司做脚手架租赁和搭建已有十多年，资质齐全，诚信经营。\r\n\r\n专业经营脚手架的租赁、 脚手架分包、 脚手架搭拆、可承接主体脚手架、旧楼改造\r\n脚手架、二次结构装修等脚手架的租赁和分包业务，负责搭建拆除运输一条龙服务。\r\n\r\n架子管（钢管）：\r\n1米、1.5米、 2米、 2.5米、 3米、 4米、6米\r\n扣件（卡子） ：\r\n转向、 接头、 十字\r\n立杆（铃铛管）：\r\n0.9米、 1.2米、 1.5米、 1.8米、 2.1米、 2.4米\r\n横杆（鸭嘴管）：\r\n0.9米、 1.2米\r\n木跳板、 移动架手架（200套以上免费送）、\r\n\r\n油托、 围挡板、 绿网、 安全网等租赁设备。\r\n\r\n联系我时，请说是在建遇良才看到的，谢谢！', '季先生', '18618253930', '1', '', '', '', '', '', '', '', '1456816354', '', '1', '0', '', '1');
