INSERT INTO `zj_publish` VALUES ('322', '319', '北京市其他无缝钢管定距包胶脚扣厂家 规格 金淼电力生产销店', '无缝钢管定距包胶脚扣厂家 规格 金淼电力生产销', '/Uploads/img/20160303/145696940662701.png,/Uploads/img/20160303/145696940694003.png', '', '', '', '36', '566', '', '2', ' 宣武- 天宁寺- 石家庄晋州市西台村', '包胶脚扣，加强脚扣系列，登杆脚扣的专业厂家。固定式直桶型脚扣，JTJH-A型脚扣，JTJH-B型脚扣,JTJH-C型脚扣,JTJH-D型脚扣一般采用高强无缝管制作，经过热处理，供应12米蹬杆三角防滑脚扣，脚扣，脚爬，安全扣具有重量轻、强度高、韧性好；可调性好，轻便灵活；安全可靠，携带方便等优点，是电工攀登不同规格的水泥杆或木质杆的理想工具。 \r\n\r\n\r\n\r\n8米，10米，12米，15米杆用脚扣型号齐全JKT6-10m 300mm，JKT6-12m 350mm，JKT8-15m 400mm，JKT15-18m 450mm，JKT18-21m 500mm，JK-T-300，JK-T-350，JK-T-400,JK-T-450，JK-T-250，JK-T-500，JK-T-240。', '张经理', '13932149212', '5', '', '', '', '', '', '', '', '1456969406', '4', '1', '0', '', '1');
INSERT INTO `zj_publish` VALUES ('323', '320', '北京市通州区pu防静电手套|涂掌手套|汗布手套厂价直销质量店', 'pu防静电手套|涂掌手套|汗布手套厂价直销质量', '/Uploads/img/20160303/145696995541845.jpg,/Uploads/img/20160303/145696995573855.jpg', '', '', '', '36', '47', '', '2', ' 通州- 通州周边- 厂家直销', '易强达防静电科技有限公司专业生产各种防静电手套，防滑手套，pu防静电手套，条纹手套，无尘乳胶手套，静电PU手套， 乳胶手套 丁晴手套蓝色 质量保证是您理想的厂家\r\n产品名称：条纹防静电点胶手套 品牌：YQG\r\n材质：涤沦加防静电丝 导电纤维间距：10（mm） 静电衰减时间：长期（sec）\r\n表面电阻：6~9（ ） 尺寸：S M L 包装：10（双/包）\r\n型号：09089 \r\n防静电手套是采用特种防静电绦纶布制作，基材由绦纶和导电纤维组成，导电 纤维间距为1CM，手套具有极好的弹性和防静电性能，避免人体产生的静电对产品造成破坏，它适合在电子行业、半导体、无尘车间及日常生活中广泛使用。 　　用于需用手套操作的防静电、净化无尘车间环境。穿戴防静电手套可避免操作人员手指直接接触静电敏感元器件，并能安全泄放操作人员所带的人体静电荷。它是半导体工业，光电工业，半导体制造业、电子显象管制造业、电脑主板生产企业、手机生产厂等工作人员工作时必需穿戴的。主要用于需用手套操作的防静电环境如电子、仪表等行业，能防止由于静电所造成的电子元器件损毁、老化；在石化行业能防止由于静电所引起的燃烧、爆炸等危险\r\n表面电阻 106-109 ；\r\n静电衰减时间 ＜0.1sec\r\n带电电荷量 ＜0.3 μ C/pair\r\n洗涤次数：A级＞100次；B级＞50\r\n尺 寸 S.M.L\r\n包 装 10 pairs/bag.100 bags/carton\r\n\r\n易强达防静电科技有限公司专业生产各种防静电手套，防滑手套，pu防静电手套，条纹手套，无尘乳胶手套，静电PU手套， 乳胶手套 丁晴手套蓝色 质量保证是您理想的厂家\r\n产品名称：PU涂掌手套\r\n尺 寸：S\\M\\L （可以自己选择备注说明，如无备注说明，统一发M型号）\r\n包 装：1双/袋，10双/包，300双/箱。 高性能密封包装\r\n产品重量： L号: 0.275公斤/10双 左右 S、M:0.225公斤/10双左右\r\n产品面料：长纤维弹力尼龙丝无缝编织内衬，掌心及手指部分聚氨酯涂层\r\n产品用途：弱电流，精密仪器的组装，产品检验，电子零件，电子产业，净化室作业等。\r\n颜 色：白色\r\n\r\n防静电性能优良，耐洗涤。 能消除静电对人体的危害，消除人体运动或穿脱时由静电产生的不快感。 能消除静电引起的衣服贴身、缠结，不易沾尘，耐脏易洗涤。 防静电手套广泛用于电子、机械制造、等各行业。主要用于需用手套操作的防静电环境如电子、仪表等行业。\r\n特性：指尖部位呈半圆形，缓解作业时指尖产生的压力；\r\n　　不易沾染尘埃，适合清洁工；\r\n　　弹力强，完全贴合手形，不易打滑，手指活动灵活，适合精细工作；\r\n　　透气性强，适合长时间作业。\r\n应用领域：适用于弱电流、精密仪器组装、产品检查等运用指尖的作业场所及电子产品、\r\n　　各种研究机关的检验工程等。\r\n　　主要用于需用防手套操作的防静电环境如电子、仪表等行业，能防止由于静电所造成的电子元器件损毁、老化；在石化行业能防止由于静电所引起的燃烧、爆炸等危险。\r\n　　它用防静电布或防静电针织物制成。用于需用防静电/净化手套操作的防静电环境。\r\n防静电涂层手套性能\r\n　　80%无尘尼龙纱加20%高性能炭纤维导电纱制成。\r\n　　指部或掌部的PU涂层有助于装配操作且不会残留指纹印。\r\n　　PU涂层中加有导电树脂使之抗静电效果极佳。\r\n　　透气性良好，可水洗 。\r\n　　表面电阻：10的3次方-10的4次方 \r\n　　防静电性能优良，耐洗涤。\r\n　　能消除静电对人体的危害，消除人体运动或穿脱时由静电产生的不快感。\r\n　　能消除静电引起的衣服贴身、缠结，不易沾尘，耐脏易洗涤。\r\n', '易先生', '15862446567', '5', '', '', '', '', '', '', '', '1456969955', '4', '1', '0', '', '1');
