INSERT INTO `zj_publish` VALUES ('329', '408', '北京市通州区北京地区厂家直销金属电缆桥架价格及型号店', '北京地区厂家直销金属电缆桥架价格及型号', '/Uploads/img/20160304/145705543397189.png,/Uploads/img/20160304/14570554337873.png', '', '', '', '36', '47', '', '2', ' 大兴- 林校路- 北京市大兴区北臧村镇马村', '北京久源华通电缆桥架厂是一家专业化集生产和销售于一体的电缆桥架企业。成立于2003年，具有从产品设计、制造、销售安装以及售后为一体化的完善体系。可以根据客户的不同需求量身定制，客户的需求就是我们的全部。\r\n    拥有先进的生产设备，雄厚的生产力和经验非富的专业人员，从而确保了企业产品的一流品质。我电缆桥架的产品采用优质钢材、先进工艺加工制作而成，具有外形美观、规格齐全、安装方便、质量过硬等特点，产品涵盖了防火电缆桥架、铝合金电缆桥架、不锈钢电缆桥架、静电喷塑电缆桥架、热镀锌电缆桥架、热浸锌电缆桥架、金属线槽、地面线槽及相关配件等诸多电缆桥架系列产品。\r\n    所有产品均通过IS091:2000质量体系管理。并获得之多荣誉证书。得到了本行业业内人士及相关行业人士的肯定，我公司本着\"保质保量、互惠互利、双赢\"的经营理念，依靠质量和技术进步才与市场竞争，多年来我厂产品已遍及华北、华东、华中等多个地带，生产的槽式、梯式、托盘式及大跨距电缆桥架广泛适用于石油、化工、兵器、电力、冶金、通讯、运输等领域。\r\n因为专业，所以值得信赖，选择华通，共创成功！\r\n欢迎有此需求的客户来电咨询、洽谈！', '张经理', '18601196266', '5', '', '', '', '', '', '', '', '1457055433', '15', '1', '0', '', '1');
