INSERT INTO `zj_publish` VALUES ('361', '919', '河北省石家庄市招20人', '', '', '', '20', '', '3', '73', '', '2', '石家庄桥西中山中华大街18号保艺大厦', '国家号召 大众创业 万众创新 创新型人才走出去一年之计在于春！　　\r\n无需面试，无需考试2016年澳门工作开始报名啦！\r\n澳门巴黎人，上普京建筑工程工作\r\n一、澳门就业前景\r\n澳门的经济自从1999年政权移交至中华人民共和国后仍然保持着世界上最开放的经济体系，回归后经济发展快速稳定。中国政府给予澳门多项支持政策，保证澳门对各类人才的需求，并对内地输澳门的各类人才进行有效的管理。澳门社会稳定，法律健全。澳门政府的劳工法极其严格，雇主必须严格按照劳工法执行，若发生雇主克扣工资或其他违法行为必然受到劳工部门的严厉惩罚。在澳门工作的务工人员工作生活都非常安定。如有意长期留在澳门工作的，只要个人努力，雇主满意，可以长期在澳门工作。\r\n二、澳门就业优势    \r\n澳门建筑业的薪酬大大高于内地城市，薪资按月发，保障又可靠，职业发展好。澳门属中国的一个特区，文化一脉相承，劳务人员生活方面，极易适应。加之地域接壤，可随时进关到内地来。可以吃住在珠海，工作在澳门。港澳对内陆游客开放，劳务人员的亲属可随时前往探望。享有极大的方便和利好。因此，到澳门就业是劳务人员满意，家长亲属放心的理想选择。\r\n三、招工要求及待遇\r\n 1、招聘工种：\r\n1）急需普工；\r\n2）急需精装木工、水电工、全能焊工、幕墙安装工、扎铁工、模板工。\r\n2、要有3年以上工作经验，年龄25-48周岁，最好有出国务工经历，身体健康；\r\n3、无犯罪前科，无澳门黑名单，要服从管理，服从安排；\r\n4、每月11700澳币底薪，加班另计，每月500澳币房补，吃饭自理；工资按月发放；\r\n5、每天工作8小时，每月休4天， 其他按澳门劳工法执行；\r\n６、办理周期平均90天左右； 先报简历雇主选人；\r\n7、劳工管理费每月400澳币劳工自付。\r\n雇主均是澳门和香港本土人，单位规范、操作严谨、合法合规。 ', '许经理', '17769010015', '4', '300', '500', '', '', '', '18', '50', '1457419384', '', '1', '0', '', '1');
