INSERT INTO `zj_publish` VALUES ('363', '939', '河北省石家庄市断桥铝门窗,肯德基门,高隔间,阳光房,封阳台店', '断桥铝门窗,肯德基门,高隔间,阳光房,封阳台', '/Uploads/img/20160308/145742653081063.png,/Uploads/img/20160308/145742653056445.png', '', '', '', '3', '73', '', '2', '新华- 新华周边- 东营铝材市场a区20号', '专业隔热断门窗，铝包木门窗，肯德基门，高隔间，阳光房，朔钢，铝合金门窗，金刚网隐形纱窗，各种隐形纱窗沙门，高中低档铝合金钛镁合金门窗, 质量保证, 真诚服本公司为了回馈新老客户，特举行优惠活动！凡通过网络，电话订购的客户均享受9.7折优惠价免费为客户测量、设计，上门安装保修1年，让客户满意为准 。\r\n\r\n主营:断桥铝门窗，塑钢门窗，阳光房，彩钢钢结构，铝木复合门窗，断桥铝单价300到600之间，总有一款适合您 。制作加工厂位于石家庄友谊北大街东营铝材市场A区18-20号，交通便利。地理位置优越。河北省门窗协会推荐门窗加工厂，本厂拥有强大的技术。专业的设备，严格的生产要求，完善的售后服务。生产工艺精良，在行业中拥有良好的口碑，选购本公司门窗保修1年，终身维修， 选择辉煌门窗就是选择放心 。\r\n\r\n公司主营产品有：断桥铝门窗，铝包木门窗，阳光房，封露台，彩钢房，金刚网纱窗，不锈钢防护网，玻璃幕墙等，所生产出来的产品具有隔音隔热性强，保温性好，坚固耐用美观大方等优点，深得业界客户的一致好评。\r\n公司主营断桥铝门窗型材门窗品牌有：德国蓝卡、德国维盾、广东凤铝、辽宁忠旺、河北澳联、山东华建等知名品牌。\r\n断桥铝门窗规格为（55，60，62，65，70，72，80，90）\r\n铝包木门窗规格为（70，75，80，88）\r\n金刚一体防盗为110系列，130系列\r\n颜色可选为各种颜色静电粉末喷涂，电泳香槟，木纹转印3D、4D手感木纹，铝包木均选用，美国红橡，俄罗斯落叶松，楸木，柞木\r\n阳光房系类可选为：铝合金钢化玻璃阳光房，钢结构岩棉板（防火）阳光房，钢结构彩钢板（保温）阳光房。\r\n顶面天窗可选：手动式天窗、电动式天窗、雨水感应式天窗。\r\n\r\n下面为大家详细介绍下断桥的好处：　　\r\n1.断桥铝门窗保温隔热性好。采用隔热型材内外框软性结合，边框采用一胶条，双毛 条的三密封形式，关闭严密，气密、水密性能特佳、保温性能优越；窗扇采用中空玻璃 结构，使窗户真正显示出隔音、隔热、保温、功能卓越，大量节省采暧和制冷费用，传 热系数K值经检测2.23—2.94w/2K以下，节能效果显著 ，几年的节能费用足以弥补前期的投资 2.断桥铝门窗防水功能。利用压力平衡原理设计有结构排水系统，下滑设计斜面阶梯式，设排水口，排水畅 通，水密性好。 　　\r\n3.断桥铝门窗防结露、结霜。断桥铝型材可实现门窗的三道密封结构，合理分离水汽腔，成功实现气水等 压平衡，显著提高门窗的水密性和气密性，达到窗净明亮的效果。 　　 4.断桥铝门窗防蚊虫纱窗设计。隐形纱窗，可内外选择安装使用，具有防蚊虫，苍蝇，尤其适合北方多蚊虫地区。 　　\r\n5.断桥铝门窗防盗、防松动装置。配上标准配置的五金锁具，保证窗户在使用中的稳固与安全。 　　\r\n6.断桥铝门窗防噪隔音。其结构经精心设计，接缝严密，试验结果，空气隔声量达到隔音30--40db，能保证在高速公路两侧50米内的居民不受噪音干扰，毗邻闹市也可保证室内宁静温馨。 本公司将以“科学管理，优良品质，优惠价格，优质服务”为宗旨，秉着“开拓创新，与时倶进”的经营理念。与国内外客户朋友合作，携手并进，共建断桥铝门窗美好未来。 公司秉承客户至上，给您最大的优惠，最低的价格！', '周丙敢', '18633031552', '5', '', '', '', '', '', '', '', '1457426530', '14', '1', '0', '', '1');
