INSERT INTO `zj_publish` VALUES ('370', '989', '河北省石家庄市招10人', '', '', '', '10', '', '3', '73', '', '2', ' 保定下属各区县的', '二、招工信息\r\n施工的木工、瓦工、钢筋工及少许装潢木工，瓦工。\r\n      1、应聘条件：热爱祖国、热爱和平，身体健康，无犯罪前科，具体要求如下：年龄22——48以下，有三年以上工作经验者并能服从组织岗位分配。\r\n2、合同期限为3年，工作签证，多劳多得，加班或计件另算，每天工作8小时，月保底8400元以上，工资按月发放，年薪不低于10万元，公司承担吃住，每星期休息一天，每年可回国一次。', '先生', '18633824776', '4', '300', '400', '', '', '', '22', '48', '1457491792', '', '1', '0', '', '1');
