INSERT INTO `zj_publish` VALUES ('380', '1043', '天津市河西区招1人', '', '', '', '1', '', '40', '57', '', '2', '大沽南路531号怡乐天地', '岗位职责：\r\n1.遵守商场设备管理制度及操作流程，负责本商场空调系统的操作、监控、运行记录、维修保养和日常安全巡查等工作。\r\n2.按时检查所辖范围内的设备运行状况、环境卫生、安全保障，按时测量商场各区域环境温度，及时调整，通过能源管理和设备改造节能降耗。\r\n3.熟悉商场内空调系统，包括空调机原理、特性、各种管道的走向、各种水泵、阀门的工艺流程。\r\n4.处理和协调设备发生的问题。\r\n5.空调运行期间，做好运行参数记录，上报主管。\r\n6.完成上级领导交办的其他工作。 \r\n任职资格：\r\n1.年龄不限，需有相关工作经验，持制冷上岗证。\r\n2.有一定沟通能力和团队合作精神，责任心强，态度端正。', '先生', '15332197951', '4', '100', '150', '', '', '17', '18', '50', '1457506381', '', '1', '0', '', '0');
INSERT INTO `zj_publish` VALUES ('381', '1060', '河北省保定市出租发电机', '', '/Uploads/img/20160309/145750929667190.png,/Uploads/img/20160309/145750929622381.png,/Uploads/img/20160309/145750929692892.png', '20', '20', '各种型号', '3', '78', '', '2', '高开- 西三环1581号 ', '本公司常年对外租赁各种建筑机械，发电机,风镐,路面切割机,移动脚手架，钎探机,电动抹光机，搅拌机，翻斗车，槽钢，电夯，磨石机，清灰机，污水泵，云石机，油锯，振动棒，气泵，电焊机，切割锯，电钻，电锤，水钻，热熔机，钢模板，步步紧等....... 对外承揽水泥路面浇筑，打马路，路面切割，水泥破碎等业务。 ', ' 韩洪涛', '13284383081', '1', '', '', '', '', '', '', '', '1457509296', '', '1', '0', '', '1');
INSERT INTO `zj_publish` VALUES ('382', '1061', '河北省保定市出租叉车', '', '/Uploads/img/20160309/145750981662512.png,/Uploads/img/20160309/145750981695254.png,/Uploads/img/20160309/145750981662603.png,/Uploads/img/20160309/145750981633358.png', '4', '20', '各种型号', '3', '78', '', '2', ' 保定南市东二环焦庄 ', '主营项目：叉车，吊车，高空作业车，折臂吊，挖掘机、铲车，破碎机、推土机、平地机、压路机租赁\r\n\r\n\r\n    保定明通大件起重设备租赁公司成立于1996年。我公司是专门从事叉车，吊车出租租赁，大件起重，运输，工厂搬迁，设备吊装等业务，及挖掘机出租，推土机出租，土石方工程，平房、楼房、厂房、桥梁等构筑物的拆除和路面破碎；土方石方挖运、工程机械租赁等专业化公司。 公司现有专业技术人员50余人，同时拥有经验丰富的工程师. 公司现拥有起重机械，叉车，吊车，高空作业车，折臂吊，挖掘机、铲车，破碎机、推土机、平地机、压路机租赁，欢迎洽谈咨询。\r\n\r\n主营项目\r\n1、叉车，吊车，高空作业车，折臂吊，挖掘机、铲车，破碎机、推土机、平地机、压路机租赁\r\n2、重量200吨以内无尘室移位、\r\n3、设备吊装、设备搬运、设备运输、\r\n4、设备装卸、设备包装、设备安装\r\n5、工厂搬迁、大件运输。\r\n6、重型配送、国际货代、\r\n7、项目物流、重型物流\r\n\r\n我们的服务承诺是：全天24小时为您服务，本公司在保定各县市设有分部，可就近派车，随叫随到绝不含糊。 租赁价格低于同期市场价， 望新老客户给予我们大力的支持和帮助，您需要租赁么?我们会满腔热情的为您提供最满意的服务!', ' 席先生', ' 18732278778', '1', '', '', '', '', '', '', '', '1457509816', '', '1', '0', '', '1');
