INSERT INTO `zj_publish` VALUES ('388', '1127', '天津市西青区出租叉车', '', '/Uploads/img/20160310/145758083625967.png', '4', '10', '各种型号', '40', '65', '', '2', ' 西青- 杨柳青- 天津市西青区杨柳青', '   北京天津恒顺叉车是天津及周边地区开展叉车业务最大、技术最全面的一家综合性服务公司，\r\n   我们主营：叉车租赁，天津二手叉车，叉车租赁，租赁叉车，叉车整机，全新叉车整机，二手叉车，手动、电动搬运车、装卸车，叉车属具、并提供叉车租赁、整车以旧换新、上门维修等服务。 \r\n   公司备有：一至十吨叉车，一百多台供您选择，可为您提供长租短租，各种配件，维修，整车大修，正新叉车专用轮胎，的大型叉车公司。用以租代卖的形式来为您解决资金运转问题。\r\n没有最好的产品，只有最好的服务！\r\n对客户的承诺是：您选择我们公司产品只是一半，您的另一半是我们企业诚挚的服务。公司一直秉承这个理念，以强大的技术支持和良好的售前售后服务作后盾，从小事做起，从细节抓起，一步一个脚印，实现了与客户的双赢和共同发展。 \r\n用顺达长平，干金色事业！', '吴先生', '13920869792', '1', '', '', '', '', '', '', '', '1457580836', '', '1', '0', '', '1');
