INSERT INTO `zj_publish` VALUES ('390', '1128', '天津市南开区出租吊车', '', '/Uploads/img/20160310/145758149010461.png', '21', '10', '各种型号', '40', '58', '', '2', ' 南开- 王顶堤- 红旗路北草华坪路', '联系人：徐经理 联系电话：15522779962 13012296878\r\n天津鑫淼源吊车设备安装租赁有限公司是集吊车出租（日租或月租）、机器搬迁、设备移位、工厂搬迁、精密吊装、锅炉搬运、地拖出租、大件吊装运输及各种高价位精密设备的货柜装卸、定位、安装等工程为主的天津搬运公司。 公司以起重吊装为主的人员均受过正规的专业训练与教育，对各种高、难、重、险的起重吊装安装工程有着丰富的工作经验。合理的价格、安全快捷的服务，同时本着公平竞争的准则，规模不断扩大，起重吊装、设备移位能力不断增强。对所承接的起重、搬运、安装等工程，根据各种设备、构件等物体的材料、结构、最强与最弱之点、线、面及重心等细节，结合现场环境进行认真、仔细的分析后，才进行各项工作，以确保工程的正确性、安全性。 我们秉承“专业、诚信、用心”的理念服务广大客户，致力完善各种类型的吊车叉车起重设备以满足不同领域的客户需求。 公司本着“为顾客着想，解顾客之忧”的服务精神，始终坚持“信誉第一，用户至上”的服务宗旨，在市场中不断发展壮大。我们会从您的角度为您考虑到每一个细小的环节，以最大限度满足您的需要。让您真正感受到务（服务）超所值 长期出租汽车吊、我们配有专业的吊装，运输，搬运人员。欢迎包台班、包月、24小时竭诚为您服务，为了您的利益，请适当提前来电预约。您的参与，是我们最好的激励！', '徐先生', '15522779962', '1', '', '', '', '', '', '', '', '1457581490', '', '1', '0', '', '1');
