INSERT INTO `zj_publish` VALUES ('408', '1251', '河北省衡水市出租吊车', '', '', '21', '10', '各种型号', '3', '81', '', '2', '桃城- 衡水市桃城区京大路与衡德路交叉口西北角', '衡水旭泽行装卸搬运公司是经市工商注册，具有独立法人资格的企业，本公司建立于2003年，对衡水市及周边的各种机械设备都很熟悉，特别擅长于医用设备，印刷机，冲床，开练蜜炼机，注塑机有良好的信誉，有一只训练有速，本领过硬的，技术精良的搬迁队伍，有8—200T吊车，3-10T叉车及平板设备运输，室内外专业搬迁，起重设备工具齐全。\r\n   本公司经营范围：专业搬厂，装卸货柜，机器吊装移位定位，设备上楼，事故抢险，机器运输，吊 叉车出租等，本公拥有雄厚的实力以安全优质，快捷的服务，最低的价钱面向社会。\r\n   本公司12年来风雨历程，感谢各位新老客户多年来的支持与厚爱使的本公司业务经验和技术实力在衡水搬运行业中处于领先地位，我们将以技术第一，安全至上，快捷可靠，合理收费作为本公司长期发展的宗旨回馈客户。', '刘先生', '13785859886', '1', '', '', '', '', '', '', '', '1457661129', '', '1', '0', '', '1');
INSERT INTO `zj_publish` VALUES ('409', '1259', '河北省衡水市出租脚手架', '', '', '22', '10', '各种型号', '3', '81', '', '2', ' 桃城- 衡水桃城区人民路电厂西邻路北', '衡水市佳帆租赁站从事移动脚手架、架子管租赁、工程施工搭设服务的专业化企业，涉足脚手架行业多年，与多家建筑公司、装饰公司、脚手架租赁公司具有长期合作关系。凭借其锐意进取的精神和科学严谨的管理，已成为国内享有美誉的知名企业。\r\n\r\n公司租赁各种门式脚手架及钢管脚手架，负责搭设拆除及运输一条龙服务。公司有一批专业的搭设队伍，资质证照齐全，承接内外墙脚手架、高空双排脚手架、看台架、广告架、舞台架、满堂红脚手架的搭设业务。\r\n公司为施工单位提供技术性搭设及拆除方案，车辆运输，精确的材料预算。\r\n\r\n租赁站项目：移动脚手架、架子管租赁、扣件租赁，木跳板租赁，油托租赁，碗扣架租赁，吊篮租赁。 \r\n\r\n移动脚手架（200套以上免费送货） 架子管租赁（扣件、木跳板、油托、绿网、安全网） 碗扣式脚手架（横杆、立杆） 备。围 挡 板（0.75mⅹ2m） 吊 篮出 租（2m--6m） 龙门架租赁、搅拌机、各种建筑机械设\r\n衡水市佳帆租赁站是一家专业提供搭设钢管、毛竹、上海脚手架搭建、钢管脚手架搭建、毛竹脚手架搭建。产品广泛应用于各种形式的建筑。高层建筑脚手架、中层整体建筑脚手架、低层整体建筑脚手架。\r\n 业务范围：（别墅，厂房，街面商铺，广告牌，内外墙粉刷，平改坡等等一切需要搭设脚手架的工程。有相关专业的证件。) \r\n数年来在全衡水周边地区，都有搭设脚手架。安全把关，做事认真。如你或者你的朋友有这方面需要欢迎和我们联系，我们将尽快的安排项目经理前去施工队洽谈，交流施工方案，做好脚手架搭设之前的沟通，以便让您对我们操作流程的了解和充分保证您的知情权，随时配合您工程的计划变更，一次合作，终身愉快！ \r\n衡水市佳帆建筑材料租赁站主要经营;长期供应的租赁建筑设备;如需购买租赁请联系我们，我们以优秀的技术人才和服务赢市场的经营理念,为客户提供满意服务，你的满意是我们追求的目标，欢迎来电咨询...\r\n联系电话：13784879019 ', '李经理', '13833866616', '1', '', '', '', '', '', '', '', '1457661517', '', '1', '0', '', '1');
INSERT INTO `zj_publish` VALUES ('410', '1260', '河北省衡水市出租吊车', '', '', '21', '10', '各种型号', '3', '81', '', '2', '桃城- 裕华中路', '衡水祥泰吊装服务有限公司，我公司备有8-350吨汽车吊车，随车吊以及各种型号升高机，对外出租，普通货物、大型机械设备装卸、市政设施、桥梁安装、（依法经批准的项目，经相关部门批准后方可开展经营活动），诚信为本，优质服务，客户的满意是连上起重永远的追求。\r\n衡水祥泰吊装服务有限公司，从事厂房吊装、设备安装；道路桥涵、设备就位、市政桥梁架设；超高层建筑的钢结构、标志、机组的吊装；预制桩驳输，桩机搬场，塔吊拆装。厂房拆除、机器设备搬场；集装箱掏箱、装箱；压机、中央空调、电梯、大罐的吊卸、装卸方桩管桩、盘路就位；钢结构安装；所有桥式类型起重机的拆、安、检；大型网架结构整体吊装；港口、码头大件装卸船及驳运。经营市政、公路、桥梁及各种相关建筑工程，工业、民用和安装工程，建筑装饰、港口,码头,机场、铁路、园林建设以及运输工程，吊车叉车出租等。\r\n我们以客户需求为发展的根本，保障服务质量，不断提高发展技术和服务领域，为客户提供安全、优质、经济、方便的起重、吊装、运输服务。 ', '王经理', '13932850913', '1', '', '', '', '', '', '', '', '1457661782', '', '1', '0', '', '1');
