INSERT INTO `zj_publish` VALUES ('496', '1061', '河北省保定市出租叉车', '', '/Uploads/img/20160317/145819859251864.png,/Uploads/img/20160317/145819859223730.png', '4', '10', '各种型号', '3', '78', '', '2', ' 南市- 南市区周边- 保定南市东二环焦庄 ', ' 保定明通大件起重设备租赁公司成立于1996年。我公司是专门从事叉车，吊车出租租赁，大件起重，运输，工厂搬迁，设备吊装等业务，及挖掘机出租，推土机出租，土石方工程，平房、楼房、厂房、桥梁等构筑物的拆除和路面破碎；土方石方挖运、工程机械租赁等专业化公司。 公司现有专业技术人员50余人，同时拥有经验丰富的工程师. 公司现拥有起重机械，叉车，吊车，高空作业车，折臂吊，挖掘机、铲车，破碎机、推土机、平地机、压路机租赁，欢迎洽谈咨询。\r\n\r\n主营项目\r\n1、叉车，吊车，高空作业车，折臂吊，挖掘机、铲车，破碎机、推土机、平地机、压路机租赁\r\n2、重量200吨以内无尘室移位、\r\n3、设备吊装、设备搬运、设备运输、\r\n4、设备装卸、设备包装、设备安装\r\n5、工厂搬迁、大件运输。\r\n6、重型配送、国际货代、\r\n7、项目物流、重型物流\r\n\r\n我们的服务承诺是：全天24小时为您服务，本公司在保定各县市设有分部，可就近派车，随叫随到绝不含糊。 租赁价格低于同期市场价， 望新老客户给予我们大力的支持和帮助，您需要租赁么?我们会满腔热情的为您提供最满意的服务!', '先生', '18732278778', '1', '', '', '', '', '', '', '', '1458198592', '', '1', '0', '', '1');
