INSERT INTO `zj_publish` VALUES ('509', '1804', '河北省邯郸市出租脚手架', '', '/Uploads/img/20160320/145844116924816.jpg,/Uploads/img/20160320/145844116986465.jpg,/Uploads/img/20160320/14584411694595.jpg', '22', '10', '各种型号', '3', '76', '', '2', ' 邯郸县- 邯郸东环与丛台路', '我厂专业生产销售移动脚手架，梯形脚手架、门型脚手架，高有1米脚手架、1。7米脚手架、1.93米脚手架、1.90米脚手架，宽宥0.96米脚手架、1.25米脚手架。\r\n移动脚手架：\r\n产品的外表现有冷镀锌、热镀锌、静电喷涂等五大类型。\r\n1.7M分三种：门式，梯式，上面可调节下面是门式的，重量：40公斤\r\n1.7M移动门式脚手架，优质脚手架，北京移动脚手架生产厂家，钢管脚手架，钢管移动门式脚手架，梯式移动脚手架销售厂家。专业生产移动脚手架供应商，装潢移动脚手架，活动梯式脚手架\r\n    脚手架，移动脚手架，1.93米移动脚手架，1.0米移动脚手架，1.5米移动脚手架，门式移动脚手架，梯式移动脚手架，脚手架生产厂家，河北移动脚手架生产厂家。\r\n移动式脚手架应用于室、内外装修；门面广告；桥梁支撑；模板支撑；满堂脚手架，墙壁脚手架等用途。具有装卸方便，安全可靠，价惠实用等优点。电动吊篮的全名称为：电动高处作业吊篮采用国内外先进技术，结构合理，与其它结构的吊篮相比较具有加高方便、操作简单、安全可靠、规格多种、投资省、效率高等特点。主要适用于高层建筑物的外墙施工等。\r\n\r\n      电动吊篮的上下动力来自于电动吊篮专用提升机。设备安装前，首先检查电动吊篮专用提升机空载时是否正常。操作工人相对吊篮必须配用安全可靠的安全带\r\n电动吊篮主要适用于以下几个工程方面： 1、幕墙工程：玻璃幕墙、石材幕墙 2、外墙保养维修工程：外墙防水堵漏、窗框防水堵漏 3、外墙翻新工程：涂装工程、石材翻新 4、外墙涂料工程 5、外墙安装LED工程 6、外墙保温工程 7、外墙门窗工程 ...\r\n电动吊篮(6米。630型。包含：篮筐1个，4根直径为8.3MM长100的油绳一根，含配重块（1吨），配电箱1个。 称重量550公斤。可做尺寸2，3，4，5，6M，根据尺寸价钱可以适当调节)', '陈先生', '15830778677', '1', '', '', '', '', '', '', '', '1458265385', '', '1', '0', '', '');
