INSERT INTO `zj_publish` VALUES ('517', '1823', '河北省邯郸市出租脚手架', '', '/Uploads/img/20160318/145826820494445.png,/Uploads/img/20160318/145826820426016.png', '22', '10', '各种型号', '3', '76', '', '2', ' 丛台- 丛台- 中华大街与北仓路交叉口 ', '公司电话：15830772202   公司主营：电动吊篮,脚蹬吊篮,手动吊篮,龙门架升降机,梯形脚手架,门型脚手架,卷扬机；\r\n\r\n我厂生产的移动脚手架坚固耐用，焊接工艺镀锌工艺优于同行业产品，使用寿命长。\r\n移动脚手架规格包括：1.8*0.96*1.7米梯式脚手架，门式脚手架，1.8*1.25*1.93米梯式脚手架，门式脚手架\r\n移动脚手架调节架包括：1.8*0.96*1.0米脚手架，1.8*1.25*1.0米脚手架 \r\n脚手架产品特点,1用途广,室内外装修,门店广告牌,桥梁,楼宇支撑,墙壁脚手架等.2多功能能单用,双用,能移动，使用简单快捷.3效率高 机动灵活，快速拆装，不用螺丝，取得了事半功倍的效率.4承载力大，稳定性好.5安全可靠，接头自锁能力好，系列标准化.6、便于管理，堆放整齐.7经济实用，成本低，占用空间小，使用时间长.\r\n多种用途\r\n1.用于楼宇、厅堂、桥梁、高架桥、隧道等模板内支顶或作飞模支承主架。\r\n2.作高层建筑的内外排栅脚手架。\r\n3.用于机电安装、船体修造及其它装修工程的活动工作平台。\r\n4.利用脚手架配上简易屋架，便可构成临时工地宿舍、仓库或工棚。\r\n5.用于搭设临时的观礼台和看台。\r\n装拆方便\r\n1.普通工人徒手插、套、挂就可以任意进行六种搭设。\r\n2.单件最大重量不超过20公斤，因此提升、装拆和运输及其方便。共效高装拆只需徒手进行，大大提高功效，脚手架装拆比扣件钢管架快1/2时间，比竹木脚手架快2/3时间。安全可靠。', '张先生', '15032879929', '1', '', '', '', '', '', '', '', '1458268204', '', '1', '0', '', '1');
INSERT INTO `zj_publish` VALUES ('518', '1825', '河北省邯郸市电动吊篮及配件正品特价销售 货款可物流代收店', '电动吊篮及配件正品特价销售 货款可物流代收', '/Uploads/img/20160318/145826965994461.jpg,/Uploads/img/20160318/145826965932366.jpg', '', '', '', '3', '76', '', '2', ' 邯郸周边- 其它- 亿达建筑机械 ', '河南亿达吊篮配件：主要生产出售ZLP630型电动吊篮专业篮筐定做，有提升机、电机、配电箱、配重块、安全锁、整流块、电缆线、钢丝绳、安全绳、八芯插头、钢带、分绳器、自锁器、电磁刹车、电缆防断器、离心限速器等一系列吊篮专用正品配件，期待您的来电，联系人刘经理 电话15936837069 13707666228', '张先生', '15936837069', '5', '', '', '', '', '', '', '', '1458269659', '17', '1', '0', '', '1');
