INSERT INTO `zj_publish` VALUES ('520', '1804', '河北省沧州市出租脚手架', '', '', '22', '1000', '1.7米', '3', '83', '', '2', '邯郸市东环与丛台路', '我厂专业生产门式移动脚手架，梯式移动脚手架，1.93米移动脚手架，1.7米移动脚手架，1.0米移动脚手架，电动吊篮，脚蹬吊篮，半封闭式自升龙门架，全封闭式自升龙门架，丝杠一体脚手架轮。\r\n产品特点：移动式脚手架具有安装快捷、牢固、灵活、适应性强等特点,产品所有部件均经冷镀锌防腐处理,经久耐用、美观大方,是广大建筑行业和装潢行业理想的辅助施工装备,平台面积15-40平方米,特别适用于狭小场所。 可靠性:门型脚手架充分发挥重要作用 我公司提供的产品经国家质检部检验合格.质量可靠。\r\n特别说明：一套脚手架包含：2片架子、2付拉杆、1个踏板、4个连接棒、4个销钉、4个开口锁销。\r\n特点：1、高强度的管材，产品经热镀锌处理，大大加长了使用寿命2、结构合理、使用简单、操作快捷灵活、安全可靠。3运输方便、拆装方便、可大量提高功效、节省大量的人力资源\r\n用途：1、用于楼宇、厅堂、桥梁、高架桥、隧道等模板内支顶2、作高层建筑的内外排栅脚手架3、用于几点安装、船体修造以及其他装修工程的活动4、利用门式脚手架配上简易屋架，便可构成临时工地宿舍、仓库或工棚5、用于搭设临时的观礼台和看台装拆\r\n方便：1、普通工人徒手插、套、挂就可以任意惊醒六种搭设。2、单件最大重量不超过20公斤，因此提升、装拆和运输及其方便。共效高：装拆只需徒手惊醒，大大提高功效，门式脚手架装拆比扣件钢管架快1/2时间爱你，比竹木架快2/3时间。\r\n全可靠：1、整体性能好：配有脚踏板、平行架、扣墙管、水平和交叉拉杆管等纵横锁位装置。2、承受作用力\r\n合理：由立管直接垂直承受压力，各性能指标满足施工需要。3、防火性能好，所有主架和配架均为钢制品。价廉实用：1、根据用户和国内外资料反映，门式架如保养好，可重复使用30此以上，竹木架是不能比拟的。2、门式脚手架实用单位面积重量比扣件式钢管架低50%，每次拆耗成本是钢管架的1/2，是竹木架的1/3，工效和效益是显著的，且建筑物越高效益越好。', '陈涛', '15830778677', '1', '', '', '', '', '', '', '', '1458279357', '', '1', '1', '', '');
