INSERT INTO `zj_publish` VALUES ('521', '1833', '河北省邯郸市出租脚手架', '', '/Uploads/img/20160318/145828240142211.png', '22', '10', '各种型号', '3', '76', '', '2', ' 邯郸县- 人民路与东环路交叉口东行两2公里路南 ', '出租脚手架\r\n批发脚手架\r\n出租高空吊篮\r\n处理七八成新脚手架\r\n邯郸脚手架出租出售安全可靠—拆装方便—价格实惠​‌‌—节约时间适用：泥工粉刷，安装广告，装灯，室内外装修，建筑施工，为了给你提供更好的方便，我公司将真诚为你服务。租用事项：租用脚手架客户须交付押金（量多面议），双方订立合同，脚手架每套（含两片门架、两根拉杆、一片踩板）每天每套租金分别为1元、1.5元、2元、不等，以租用时间长短而定，租用时间越长越优惠，送货上门服务（运费由租用方支付）。 ', '蔡先生', '15081703358', '1', '', '', '', '', '', '', '', '1458282401', '', '1', '0', '', '1');
