INSERT INTO `zj_publish` VALUES ('523', '1836', '河北省邯郸市标准件 丝杠店', '标准件 丝杠', '', '', '', '', '3', '76', '', '2', ' 邯郸县- 河北铺飞宇27排a2 ', '永1年5县1调7质6丝0杠1准0件0厂4地5处全国最大的标准件生产基地——河北省永年县。是冀南大地一家规模较大、建厂较早的丝杠异型件厂专业生产厂家。紧临京广铁路，107国道和京深高速公路，交通十分便利。\r\n\r\n    本公司具有高强丝杠和螺母配套产品的悠久历史，具有产品研发、生产和测试的雄厚实力。\r\n\r\n 　 主要产品：\r\n\r\n         丝杠类：  宁波8·8级，10·9级，12·9级调质牙条\r\n\r\n                   45#国标，细扣，反扣高强度牙条\r\n\r\n                   普通正扣，反扣，细扣黑白牙条\r\n\r\n         螺母类：   35crmoa螺母，45#螺母，英制，美制螺母\r\n\r\n                    高强度8级，10级，12级螺母\r\n\r\n         配件类：   高强度加强型，国标型，行标型保质卡头\r\n\r\n                    阀门手轮，电梯轨道卡\r\n\r\n                    花栏螺丝，\r\n\r\n                    平垫弹垫', '朱先生', '15176010045', '5', '', '', '', '', '', '', '', '1458283956', '14', '1', '0', '', '1');
