INSERT INTO `zj_setintegral` VALUES ('1', '3000', '900', '5', '建遇良才元宝规则\r\n\r\n1. 我怎样才能赚得更多的元宝？\r\n1） 每天签到是获得积分的最佳方式。\r\n        签到1天可得5元宝\r\n        连续签到2天可得10元宝\r\n        连续签到3天可得15元宝\r\n        连续签到4天可得25元宝\r\n        连续签到5天可得30元宝\r\n        连续签到6天可得35元宝\r\n        连续签到7天或7天以上15天以内每天可得45元宝\r\n        连续签到15天或15天以上每天可得60元宝\r\n        注：签到中断后，累计连续签到天数将重新计算。\r\n2） 注册后提交个人认证信息并审核通过即可获得900元宝；\r\n3） 第一次分享“建遇良才”APP到新浪微博、微信朋友圈、QQ空间均可获得500元宝；\r\n4） 第一次分享“建遇良才”APP给微信好友、QQ好友均可获得200元宝；\r\n5） 每天第一次分享职位详情、项目详情等可获得30元宝；\r\n6） 每推荐一位工友，在其完成注册后，可获3000元宝/位，上不封顶，推荐越多，赚得越多。\r\n2. 元宝的能带来哪些福利？\r\n        在建遇良才，小小元宝可以为你带来大大福利，您可以在积分商城兑换各种积分好礼。\r\n3. 兑换规则是什么？\r\n1）   元宝均不能变现，只用于积分商城中商品的兑换；\r\n2）   如果恶意刷元宝会受到惩罚，扣除所有元宝，并注销账户。\r\n4.     最终解释权归建遇良才所有。\r\n', '900', '500', '200', '30');
